import React from "react";
import "./BillFrom.css";

function BillFrom() {
  return (
    <React.Fragment>
      <p className="bill-from">Bill From</p>
      <label htmlFor="street-address">Street Address</label>
      <input type="text" />
    </React.Fragment>
  );
}

export default BillFrom;
